import React from 'react';
import './bloodPressure.scss';
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";

interface IProps {}
interface IState {
    sysBp: number | undefined,
    diaBp: number | undefined,
    atDate: Date,
    classification: string | undefined,
}

class Hypertension extends React.PureComponent<IProps, IState> {
    constructor(props: IProps) {
        super(props)

        this.state = {
            sysBp: undefined,
            diaBp: undefined,
            atDate: new Date(),
            classification: undefined,
        }
    }

    formatDate(date: Date) {
        // let date = new Date();
        return `${date.getFullYear().toString()}-${(date.getMonth() + 1).toString().padStart(2, "0")}-` +
            `${date.getDate().toString().padStart(2, "0")}`;
    }

    postData = async (url = '', data = {}) => {
          const response = await fetch(url, {
            method: 'POST',
            mode: 'cors',
            cache: 'no-cache',
            credentials: 'same-origin',
            headers: {
                'Content-Type': 'application/json',
            },
            redirect: 'follow',
            referrer: 'no-referrer',
            body: JSON.stringify(data),
        });
        return await response.json();
    }

    inputChangedHandler(date: any) {
        const formData = Object.assign({}, this.state.formData);
        formData.atDate = date;
        this.setState({ formData: formData });
    }

    render() {
        // this.postData(`${process.env.REACT_APP_API_URL}/hypertension`, { sysBp: 180, diaBp: 80, atDate: Date.now() })
        // .then(data => console.log(data))
        // .catch(error => console.error(error));

        return <div className="hypertension-form-input">
            <label className="form-lbl">Systole</label><input id="sysBp" autoComplete="off" value={this.state.sysBp}/>
            <label className="form-lbl">Diastole</label><input id="diaBp" autoComplete="off"/>
            <label className="form-lbl">Date</label>
            <DatePicker
            selected={this.state.atDate}
            onChange={(event) => this.inputChangedHandler(event)}
        />
        </div>
    }
}

export default Hypertension;
